import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import barcode from "./barcode";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

const images = {
  impressao:
    "data:image/png;base64,",
  checkFechado:
    "data:image/png;base64,",
  checkA:
    "data:image/png;base64,",
  checkB:
    "data:image/png;base64,",
  checkC:
    "data:image/png;base64,",
  checkD:
    "data:image/png;base64,",
  checkE:
    "data:image/png;base64,",
  unchecked:
    "data:image/png;base64,",

  unifap:
    "data:image/jpeg;base64,",
};

function textoBasico(text, fontSize) {
  return { text, fontSize: fontSize ? fontSize : 9 };
}

function blocoAlternativa(letra) {
  let letraUsada = "";
  switch (letra) {
    case "A":
      letraUsada = images.checkA;
      break;
    case "B":
      letraUsada = images.checkB;
      break;
    case "C":
      letraUsada = images.checkC;
      break;
    case "D":
      letraUsada = images.checkD;
      break;
    case "E":
      letraUsada = images.checkE;
      break;
  }
  return {
    columns: [
      { text: "", width: "*" },
      { image: letraUsada, width: 10 },
      { text: "", width: "*" },
    ],
  };
}

function colunaQuestao(titulo) {
  return {
    table: {
      widths: ["auto"],
      headerRows: 1,
      alignment: "center",
      body: [
        [titulo],
        [
          [
            blocoAlternativa("A"),
            blocoAlternativa("B"),
            blocoAlternativa("C"),
            blocoAlternativa("D"),
            blocoAlternativa("E"),
          ],
        ],
      ],
    },
  };
}

function generatePage(process, candidate, maxQuestions, date) {
  //   const warnSizes = 9;
  //   console.log(process, "processo", candidate, "candaidto");
  //   const code = barcode(candidate.number);
  const code = barcode(candidate["INSCRIÇÃO"]);
  const questoes = [
    {
      columns: [],
    },
  ];
  for (let i = 1; i <= maxQuestions; i++) {
    const numeroQuestao = i < 10 ? `0${i}` : i;
    questoes[questoes.length - 1].columns.push(
      colunaQuestao(`Q${numeroQuestao}`)
    );
    if (i % 15 === 0) {
      questoes.push(textoBasico(" ", 1));
      questoes.push({
        columns: [],
      });
    }
  }
  if (questoes[questoes.length - 1].columns.length % 15 !== 0) {
    const faltantes = 15 - questoes[questoes.length - 1].columns.length;
    for (let i = 0; i < faltantes; i++) {
      questoes[questoes.length - 1].columns.push(textoBasico(" "));
    }
  }
  // const fontSize = 9;
  return {
    content: [
      {
        columns: [
          [
            {
              table: {
                widths: ["auto", "*"],
                body: [
                  [
                    {
                      image: images.unifap,
                      width: 35,
                    },
                    {
                      columns: [
                        [
                          {
                            text: "UNIVERSIDADE FEDERAL DO AMAPÁ",
                            bold: true,
                            alignment: "center",
                          },
                          {
                            text: "PRÓ-REITORIA ENSINO DE DE GRADUAÇÃO",
                            bold: true,
                            alignment: "center",
                          },
                          {
                            text: "DEPARTAMENTO DE PROCESSOS SELETIVOS E CONCURSOS",
                            bold: true,
                            alignment: "center",
                          },
                          {
                            text: "Residência Multiprofissional em Saúde Coletiva 2022",
                            bold: true,
                            alignment: "center",
                          },
                        ],
                      ],
                    },
                  ],
                ],
              },
            },
            { text: " ", fontSize: 1 },
            {
              table: {
                widths: ["*"],
                body: [
                  [textoBasico(`${process}`)],
                  [textoBasico(`PROVA: ${candidate["CURSO"]}`)],
                ],
              },
            },
          ],
          { image: images.impressao, width: 96 },
        ],
      },
      { text: " ", fontSize: 1 },
      {
        table: {
          widths: ["*", "auto", "auto"],
          body: [
            [
              textoBasico("LOCAL: Bloco de Pós Graduação"),
              textoBasico(`${candidate["LOCAL"]}`),
              textoBasico(`DATA: ${date}`),
            ],
          ],
        },
      },
      { text: " ", fontSize: 1 },
      {
        table: {
          widths: ["*", "auto", "auto"],
          body: [
            [
              textoBasico(`NOME: ${candidate["NOME"]}`),
              textoBasico(`N. INSC.: ${candidate["INSCRIÇÃO"]}`),
              textoBasico(`CPF: ${candidate["CPF"]}`),
            ],
          ],
        },
      },
      {
        columns: [
          [
            { text: "ASSINATURA DO CANDIDATO", fontSize: 9, width: "*" },
            {
              table: {
                widths: ["*"],
                body: [[" "]],
              },
            },
          ],
          { image: code, width: 125 },
          [
            {
              width: "auto",
              columns: [
                { image: images.unchecked, width: 10 },
                { text: "ELIMINADO", width: "auto", fontSize: 9 },
              ],
            },
            {
              width: "auto",
              columns: [
                { image: images.unchecked, width: 10 },
                { text: "AUSENTE", width: "auto", fontSize: 9 },
              ],
            },
          ],
        ],
      },
      {
        columnGap: 10,
        columns: [
          [
            textoBasico("ASSINATURA DO FISCAL 1"),
            {
              table: {
                widths: ["*"],
                body: [[" "]],
              },
            },
          ],
          [
            textoBasico("ASSINATURA DO FISCAL 2"),
            {
              table: {
                widths: ["*"],
                body: [[" "]],
              },
            },
          ],
        ],
      },

      { text: " ", fontSize: 110 },
      ...questoes,
      { text: " ", fontSize: 110 },
      {
        text: "INSTRUÇÕES:",
        bold: true,
        fontSize: 9,
      },
      {
        fontSize: 8,
        ol: [
          textoBasico(
            "Confira seus dados impressos nessa folha e assine no local indicado"
          ),
          textoBasico("Preencha somente uma resposta por questão"),
          textoBasico("Não deixe nenhuma questão sem resposta"),
          textoBasico(
            "Utilize caneta esferográfica azul ou preta de material transparente para preencher suas respostas"
          ),
          {
            columns: [
              {
                text: textoBasico(
                  "Preencha somente dentro do campo, conforme modelo: "
                ),
                width: "auto",
              },
              { image: images.checkFechado, width: 10 },
            ],
          },
          textoBasico("Qualquer dúvida fale com o fiscal de sala"),
        ],
      },
    ],
  };
}

function generatePdf(i, process, candidate, maxQuestions, date) {
  if (i === 70) {
    const page = generatePage(process, candidate, maxQuestions, date);
    pdfMake.createPdf(page).open(); //("prova.pdf");
  }
  //   return pages;
  //   return new Promise((res) => {
  //     pdfMake.createPdf({ content: page }).getBuffer((result) => res(result));
  //   });
}

export default generatePdf;
